import React from 'react';

export const Input = () => {
	const handleKeyDown = (event) => {
		if(event.key === "Enter") {
			event.preventDefault();
			console.log("enter");
		}
	};

	return <input type="text" onKeyDown={handleKeyDown}/>
};
